import React from "react";
import "./Address.css";
import Edit from "../assets/Address/To edit.svg";
import Close from "../assets/Address/Close.svg";
export default function Address() {
  return (
    <div className="address">
      <p>Select Address</p>
      <div className="addressContainer">
        <div className="addressContent">
          <input type="radio" />
          <div className="addressDetails">
            <p>2118 Thornidge</p>
            <p>2118 Thoonidge Cir. Syracuse, Connecticut 35624</p>
            <p>(209) 555-0104</p>
          </div>
        </div>
        <div className="addressBtn">
          <button>
            <img src={Edit} />
          </button>
          <button>
            <img src={Close} />
          </button>
        </div>
      </div>
    </div>
  );
}
